      'body' => array(
        'und' => array(
          array(
            'value' => "<h2>The role of a catalog</h2>\r\n\r\n<p>It is important to understand that the INTEGRAL instruments are equipped with coded mask. It is tus necessary to specify a sky model to extract spectra or light curve. If you do not supply a catalog, the infrastructure will first produce an image and take all the source, with possible contamination from spurious detections. See the <a href=\"https://www.isdc.unige.ch/integral/download/osa/doc/11.1/osa_um_ibis/man.html\" target=\"_blank\">IBIS user manual</a> for details.</p>\r\n\r\n<p>It is thus strongly encouraged to prepare explicitely a <a href=\"ibis-isgri-image-new-source\">catalog through an image</a>, edit the catalog and then submit the spectral extraction. A common practice is to make an image from a subset of science windows by adjusting the \"Maximum number of ScWs\" parameter and then extract a spectrum from all science windows. In the platform, a defaul binning is applied to the spectrum.</p>\r\n\r\n<p>Note that all this can be done also using the python API, see <a href=\"https://gitlab.astro.unige.ch/integral/qla/maxij1803\" target=\"_blank\">this notebook</a>.</p>\r\n\r\n<h2>Light-curve extraction from a catalog</h2>\r\n\r\n<p>Suppose that you have <a href=\"ibis-isgr-image-new-source\">succesfully extracted an image</a> and get to the point</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/screenshot-frontendstagingodahubio-20210602-110838.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/screenshot-frontendstagingodahubio-20210602-110838.png?itok=jr_gyG2w\" style=\"height:446px; width:480px\" /> </a></p>\r\n\r\n<p>You should delete the source and the select Light curve with the relative time bins (see the red-shaded region below).</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/lc-extract.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/lc-extract.png?itok=m14Al3Rx\" style=\"height:406px; width:480px\" /></a></p>\r\n\r\n<p>Once the light curve is ready, you will receive an email as</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/email-lc0.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/email-lc0.png?itok=U3GyV7LJ\" style=\"height:223px; width:480px\" /> </a></p>\r\n\r\n<p>You can then click on the URL and then click on \"Close\".</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/ready-lc0.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/ready-lc0.png?itok=JCqrOXN5\" style=\"height:225px; width:480px\" /> </a></p>\r\n\r\n<p>to obtain</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/lc-view0.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/lc-view0.png?itok=lpnAURtT\" style=\"height:359px; width:480px\" /> </a></p>\r\n\r\n<p>you click on \"view\" the lightcurve you prefer and this can be visualized and then downloaded clicking the \"Download\" button.</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/lc-isgri.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/lc-isgri.png?itok=nxo0bsIC\" style=\"height:396px; width:480px\" /> </a></p>\r\n\r\n<p>Go to the main&nbsp;<a href=\"http://cdcidev.mtmco.net/cdci/astrooda/help/astrooda\">Astrooda Help</a></p>\r\n",
            'summary' => '',
            'format' => 'full_html',
            'safe_value' => "<h2>The role of a catalog</h2>\n\n<p>It is important to understand that the INTEGRAL instruments are equipped with coded mask. It is tus necessary to specify a sky model to extract spectra or light curve. If you do not supply a catalog, the infrastructure will first produce an image and take all the source, with possible contamination from spurious detections. See the <a href=\"https://www.isdc.unige.ch/integral/download/osa/doc/11.1/osa_um_ibis/man.html\" target=\"_blank\">IBIS user manual</a> for details.</p>\n\n<p>It is thus strongly encouraged to prepare explicitely a <a href=\"ibis-isgri-image-new-source\">catalog through an image</a>, edit the catalog and then submit the spectral extraction. A common practice is to make an image from a subset of science windows by adjusting the \"Maximum number of ScWs\" parameter and then extract a spectrum from all science windows. In the platform, a defaul binning is applied to the spectrum.</p>\n\n<p>Note that all this can be done also using the python API, see <a href=\"https://gitlab.astro.unige.ch/integral/qla/maxij1803\" target=\"_blank\">this notebook</a>.</p>\n\n<h2>Light-curve extraction from a catalog</h2>\n\n<p>Suppose that you have <a href=\"ibis-isgr-image-new-source\">succesfully extracted an image</a> and get to the point</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/screenshot-frontendstagingodahubio-20210602-110838.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/screenshot-frontendstagingodahubio-20210602-110838.png?itok=jr_gyG2w\" style=\"height:446px; width:480px\" /> </a></p>\n\n<p>You should delete the source and the select Light curve with the relative time bins (see the red-shaded region below).</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/lc-extract.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/lc-extract.png?itok=m14Al3Rx\" style=\"height:406px; width:480px\" /></a></p>\n\n<p>Once the light curve is ready, you will receive an email as</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/email-lc0.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/email-lc0.png?itok=U3GyV7LJ\" style=\"height:223px; width:480px\" /> </a></p>\n\n<p>You can then click on the URL and then click on \"Close\".</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/ready-lc0.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/ready-lc0.png?itok=JCqrOXN5\" style=\"height:225px; width:480px\" /> </a></p>\n\n<p>to obtain</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/lc-view0.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/lc-view0.png?itok=lpnAURtT\" style=\"height:359px; width:480px\" /> </a></p>\n\n<p>you click on \"view\" the lightcurve you prefer and this can be visualized and then downloaded clicking the \"Download\" button.</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/lc-isgri.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/lc-isgri.png?itok=nxo0bsIC\" style=\"height:396px; width:480px\" /> </a></p>\n\n<p>Go to the mainÂ <a href=\"http://cdcidev.mtmco.net/cdci/astrooda/help/astrooda\">Astrooda Help</a></p>\n",
